masks.initializationCode:
[eStr, poly, shift] = commblkpnseq3(gcb, 'init', poly, outBitMaskSource, shift, sampPerFrame);
if eStr.ecode
	error(eStr.eID, eStr.emsg);
end
% Initial states are from the dialog always
iniStaSource = 1;

if strcmp(polarity, 'Positive')
    polarityGain = 1;
else
    polarityGain = -1;
end
commblkunitobipolar(dataType, M);

blkh = gcbh;
fcn=0; %Set the flag to compute the variance
reset=reset_popup-1;
dtInfo = dspGetFixptDataTypeInfo(blkh,31);

blkh = gcbh;
fcn=0; %Set the flag to compute the variance
reset=reset_popup-1;
dtInfo = dspGetFixptDataTypeInfo(blkh,31);

[eStr, poly, shift] = commblkpnseq3(gcb, 'init', poly, outBitMaskSource, shift, sampPerFrame);
if eStr.ecode
	error(eStr.eID, eStr.emsg);
end
% Initial states are from the dialog always
iniStaSource = 1;

if strcmp(polarity, 'Positive')
    polarityGain = 1;
else
    polarityGain = -1;
end
commblkunitobipolar(dataType, M);
